  [],\n\t\"revision_timestamp\": \"2016-10-15T16:33:50.357598\",\n\t\"name\": \"parker-river-national-wildlife-refuge-narrative-report-sept-dec-1962\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Parker River
  National Wildlife Refuge summarizes refuge activities from September through December
  of 1962. The report begins with general information about the yearu2019s weather
  and habitat conditions. Wildlife- including migratory birds, upland game birds,
  big game animals, fur animals, predators, rodents, other mammals, predaceous birds,
  fish, reptiles, and disease- is also covered. The report includes a refuge development
  and maintenance section which discusses physical developments, plantings, collections
  and receipts, control of vegetation, planned burning, and fires. Resource management
  is outlined; haying was the only resource utilized during this period. A progress
  report on field investigations and waterfowl banding is also included. The public
  relations section of the report discusses recreational uses of the refuge, refuge
  visitors, refuge participation, hunting, and violations. Finally, items of interest,
  photographs, and N-R forms are provided.\",\n\t\"license_title\": \"License Not
